/*Table structure for table `purcharse_diff_log` */

DROP TABLE IF EXISTS `purcharse_diff_log`;

CREATE TABLE `purcharse_diff_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `purcharse_id` varchar(20) DEFAULT NULL COMMENT '采购单号',
  `product_id` varchar(50) DEFAULT NULL COMMENT '货品唯一标识,产品号+size',
  `product_size` varchar(10) DEFAULT NULL COMMENT '差异数量',
  `state` varchar(10) DEFAULT 'A' COMMENT 'A：待审核;B:已处理,C:删除',
  `operator` varchar(20) DEFAULT NULL COMMENT '操作员',
  `submit_date` datetime DEFAULT NULL COMMENT '提交日期',
  `check_date` varchar(20) DEFAULT NULL COMMENT '审核日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='采购单异常日志';

