/*Table structure for table `purchase_order` */

DROP TABLE IF EXISTS `purchase_order`;

CREATE TABLE `purchase_order` (
  `order_id` varchar(50) NOT NULL COMMENT '用户导入',
  `supplier_id` int(11) DEFAULT NULL COMMENT '供应商ID',
  `purchase_date` varchar(20) DEFAULT NULL COMMENT '采购日期',
  `purchase_count` int(10) DEFAULT NULL COMMENT '采购总数量',
  `order_state` varchar(5) DEFAULT NULL COMMENT '状态，具体数据在tb_base_config中配置',
  `arrive_date` varchar(20) DEFAULT NULL COMMENT '到货时间',
  `c_time` varchar(20) DEFAULT NULL COMMENT '创建日期',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='采购单';

/*Data for the table `purchase_order` */

/*Table structure for table `sh_product` */

DROP TABLE IF EXISTS `sh_product`;

CREATE TABLE `sh_product` (
  `product_id` varchar(50) DEFAULT NULL,
  `product_code` varchar(50) DEFAULT NULL COMMENT '条形码',
  `sh_id` varchar(50) DEFAULT NULL COMMENT '仓位编号',
  `count` int(10) DEFAULT NULL COMMENT '存放数量'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓位-货品映射 ';

/*Data for the table `sh_product` */

/*Table structure for table `shop_order` */

DROP TABLE IF EXISTS `shop_order`;

CREATE TABLE `shop_order` (
  `id` int(9) NOT NULL AUTO_INCREMENT,
  `order_id` varchar(20) DEFAULT NULL COMMENT '订单号',
  `shop_name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `product_code` varchar(20) DEFAULT NULL COMMENT '商品编码',
  `count` int(6) DEFAULT '0' COMMENT '数量',
  `size` varchar(10) DEFAULT NULL COMMENT '尺码',
  `store_place` varchar(50) DEFAULT NULL COMMENT '仓位',
  `is_have_product_flag` varchar(2) DEFAULT NULL COMMENT '是否有货 1 有 2 没有',
  `order_note` varchar(500) DEFAULT NULL COMMENT '订单备忘录',
  `express_id` varchar(20) DEFAULT NULL COMMENT '快递号',
  `order_code` varchar(50) DEFAULT NULL COMMENT '订单编号',
  `price` varchar(20) DEFAULT NULL COMMENT '价格',
  `state` varchar(2) DEFAULT NULL COMMENT '状态 1 匹配成功 2 匹配失败 3 异常 4 已确认 5 已出库 6 已删除',
  `channel` varchar(20) DEFAULT NULL COMMENT '渠道优化',
  `note` varchar(500) DEFAULT NULL COMMENT '备注',
  `freight` varchar(10) DEFAULT NULL COMMENT '运费',
  `zip_code` varchar(10) DEFAULT NULL COMMENT '邮编',
  `address` varchar(200) DEFAULT NULL COMMENT '收货地址',
  `telephone` varchar(30) DEFAULT NULL COMMENT '联系方式',
  `consignee_name` varchar(20) DEFAULT NULL COMMENT '收货人姓名',
  `delivery_method` varchar(20) DEFAULT NULL COMMENT '发货方式',
  `time` varchar(20) DEFAULT NULL COMMENT '时间',
  `abnormal_message` varchar(200) DEFAULT NULL COMMENT '异常审核描述',
  `islocal` int(1) DEFAULT '0' COMMENT '0 本地库  2 外地库',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=172 DEFAULT CHARSET=utf8 COMMENT='订单';

