/*Table structure for table `tb_shop` */

DROP TABLE IF EXISTS `tb_shop`;

CREATE TABLE `tb_shop` (
  `shop_id` varchar(50) NOT NULL COMMENT 'md5加密店铺中文名称后可得',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `shop_charger` varchar(50) DEFAULT NULL COMMENT '店铺负责人',
  `privilege_level` varchar(5) DEFAULT NULL COMMENT '店铺在自动配货时的优先级，',
  PRIMARY KEY (`shop_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺信息';

