/*Table structure for table `tb_storehouse` */

DROP TABLE IF EXISTS `tb_storehouse`;

CREATE TABLE `tb_storehouse` (
  `sh_id` varchar(50) NOT NULL COMMENT '仓库编号',
  `sh_name` varchar(100) DEFAULT NULL COMMENT '仓库名称',
  `sh_type` varchar(5) DEFAULT NULL COMMENT '仓库类型（1 外地或 2 本地）',
  `sh_address` varchar(500) DEFAULT NULL COMMENT '所在地址',
  PRIMARY KEY (`sh_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库信息表';

